function App() {
  let title = 'Blog Post 1';
  let body = 'this is my blog post';

  let comments = [
    { id: 1, text: 'comment1' },
    { id: 2, text: 'comment2' },
    { id: 3, text: 'comment3' }
  ]

  return (
    <div className='container'>
      <h1>{title}</h1>
      <p>{body}</p>
      <div className="comments">
        <h3>Comments ({comments.length})</h3>
        <ul>{comments.map(comment => <li>{comment.text}</li>)}</ul>
      </div>
    </div>
  )
}

export default App;
